                    if (cc[i+2] == "-") { flag   = false }    // (?-x) (?-x:
                    if (cc[i+2] == "x") { flag_x = flag  }    // (?x) (?x:
                    if (cc[i+2] == "i") { flag_i = flag  }    // (?i) (?i:
                    if (cc[i+2] == "s") { flag_s = flag  }    // (?s) (?s:
